import React from "react";
import { Routes, Route } from "react-router-dom";
import data from "../data.js";
import Review from "../components/Reviews/Review";
import ReviewSummary from "../components/Reviews/ReviewSummary";
import Product from "../components/products/Product";
import Spin from "../components/Spin";
import CongratsModal from "../components/Modals/CongratsModal";
import InfoModal from "../components/Modals/InfoModal";
import ThanksModal from "../components//Modals/ThanksModal";
import AgeGate from "../components/AgeGate";
import LoginLogo from "../components/logins/LoginLogo";
import Login from "../components/logins/Login";
import GuestDashboard from "../components/GuestDashboards/GuestDashboard";
import DarkMode from "../components/Home/DarkMode";
import Home from "../components/Home/Home.js";
import LoginPage from "../components/logins/LoginPage.js";
import ProductScan from "../components/products/ProductScan.js";
import ProductConfirm from "../components/products/ProductConfirm.js";
import ProductStartReview from "../components/products/ProductStartReview.js";
import ProductAddImage from "../components/products/ProductAddImage.js";
import AddImage from "../components/AddImage.js";
import ReviewSummaryAddImg from "../components/Reviews/ReviewSummaryAddImg.js";
import HomeStar from "../components/Home/HomeStar.js";
import Profile from "../components/Home/Profile.js";
import ReviewWithoutImg from "../components/Reviews/ReviewWithoutImg.js";
import ReviewAddImg from "../components/Reviews/ReviewAddImg.js";
import ReviewSummaryDoja from "../components/Reviews/ReviewSummaryDoja.js";
import CreateAccout from "../components/Home/CreateAccout.js";
import GuestDashboardAsk from "../components/GuestDashboards/GuestDashboardAsk.js";
import Dashboard from "../components/GuestDashboards/Dashboard.js";
import DashboardAccess from "../components/GuestDashboards/DashboardAccess.js";
import AgeGateLight from "../components/AgeGateLight.js";
import EmailConfirmation from "../components/EmailConfirmation.js";

function AppRoutes() {
  const reviewData = data.map((item) => {
    return <Review key={item.id} item={item} />;
  });

  const reviewData2 = data.map((item) => {
    return <ReviewWithoutImg key={item.id} item={item} />;
  });
  return (
    <div>
      <Routes>
        <Route path="/" element={reviewData} />
        <Route
          path="review-summary"
          element={
            <ReviewSummary
              rectangle={data[0].rectangle}
              coloredStar={data[0].vector}
              whiteStar={data[0].vector2}
              img={data[0].imgUrl}
            />
          }
        />
        <Route
          path="product"
          element={
            <Product
              img={data[0].rectangle}
              coloredStar={data[0].vector}
              whiteStar={data[0].vector2}
            />
          }
        />
        <Route path="congrats-modal" element={<CongratsModal />} />
        <Route path="info-modal" element={<InfoModal />} />
        <Route path="thanks-modal" element={<ThanksModal />} />
        <Route path="spin" element={<Spin />} />
        <Route path="age-gate" element={<AgeGate />} />
        <Route path="login-logo" element={<LoginLogo />} />
        <Route path="login" element={<Login />} />
        <Route path="guest-dashboard" element={<GuestDashboard />} />
        <Route path="dark-mode" element={<DarkMode />} />
        <Route path="home" element={<Home />} />
        <Route path="login-page" element={<LoginPage />} />
        <Route path="product-scan" element={<ProductScan />} />
        <Route path="product-confirm" element={<ProductConfirm />} />
        <Route path="product-start-review" element={<ProductStartReview />} />
        <Route path="product-add-image" element={<ProductAddImage />} />

        <Route path="add-another-image" element={<AddImage />} />
        <Route
          path="review-summary-add-img"
          element={<ReviewSummaryAddImg />}
        />
        <Route path="home-star" element={<HomeStar />} />
        <Route path="profile" element={<Profile />} />
        <Route path="review-without-img" element={reviewData2} />
        <Route path="review-add-img" element={<ReviewAddImg />} />
        <Route path="review-doja" element={<ReviewSummaryDoja />} />
        <Route path="create-account" element={<CreateAccout />} />
        <Route path="guest-ask" element={<GuestDashboardAsk />} />
        <Route path="dashboard" element={<Dashboard />} />
        <Route path="dashboard-access" element={<DashboardAccess />} />
        <Route path="age-gate-light" element={<AgeGateLight />} />
        <Route path="email-confirm" element={<EmailConfirmation />} />
      </Routes>
    </div>
  );
}

export default AppRoutes;
